    return (
        <div>
            <div className="content">
            <section>
            <img src={logoImg} alt="Cadastro Simples"></img>
            <hi>Cadastro</hi>
            <p>Faça seu cadastro, entre na pataforma e ajude pessoas a encontrarem os casos da sua ONG.</p>
            <Link className="back-link" to  = "/register"><FiLogIn size={16} color="#E02041"/>Não tenho cadastro </Link> 
            </section>

            <form>

            </form>

            </div>
        </div>
    )
}
